          "strokeOpacity": {"signal": "!groupSelector && (groupHover.stk4 == datum.stk4 || groupHover.stk5 == datum.stk5) ? 0.9 : 0.3"},
          "zindex": {"signal": "!groupSelector && (groupHover.stk4 == datum.stk4 || groupHover.stk5 == datum.stk5) ? 1 : 0"},
          "tooltip": {"signal": "datum.threadId  + ' : ' + datum.stk4 + ' → ' + datum.stk5 + '    ' + format(datum.size, ',.0f') + '   (' + format(datum.percentage, '.1%') + ')'"}
        },
        "hover": {"strokeOpacity": {"value": 0.75}}
      }
    },
    {
      "type": "rect",
      "name": "groupMark",
      "from": {"data": "groups"},
      "encode": {
        "enter": {"fill": {"scale": "color", "field": "grpId"}, "width": {"scale": "x", "band": 1}},
        "update": {
          "x": {"scale": "x", "field": "stack"},
          "y": {"field": "scaledY0"},
          "y2": {"field": "scaledY1"},
          "fillOpacity": {"value": 0.6},
          "tooltip": {"signal": "datum.grpId + ': ' + format(datum.total, ',.0f') + '   (' + format(datum.percentage, '.1%') + ')'"}
        },
        "hover": {"fillOpacity": {"value": 1}}
      }
    },
    {
      "type": "text",
      "from": {"data": "groups"},
      "interactive": false,
      "encode": {
        "update": {
          "x": {"signal": "scale('x', datum.stack) + (datum.rightLabel ? bandwidth('x') + 8 : -8)"},
          "yc": {"signal": "(datum.scaledY0 + datum.scaledY1)/2"},
          "align": {"signal": "datum.rightLabel ? 'left' : 'right'"},
          "baseline": {"value": "middle"},
          "fontWeight": {"value": "bold"},
          "fontSize": {"value": 12},
          "text": {"signal": "abs(datum.scaledY0-datum.scaledY1) > 13 ? datum.grpId : ''"}
        }
      }
    },
    {
      "type": "group",
      "data": [{"name": "dataForShowAll", "values": [{}], "transform": [{"type": "filter", "expr": "groupSelector"}]}],
      "encode": {"enter": {"xc": {"signal": "width/2"}, "y": {"value": 30}, "width": {"value": 80}, "height": {"value": 30}}},
      "marks": [
        {
          "type": "group",
          "name": "groupReset",
          "from": {"data": "dataForShowAll"},
          "encode": {
            "enter": {"cornerRadius": {"value": 6}, "fill": {"value": "#f5f5f5"},"stroke": {"value": "#c1c1c1"},
              "strokeWidth": {"value": 2}, "height": {"field": {"group": "height"}}, "width": {"field": {"group": "width"}}},
            "update": {"opacity": {"value": 1}},
            "hover": {"fill": {"value": 0.7}}
          },
          "marks": [
            {
              "type": "text",
              "interactive": false,
              "encode": {
                "enter": {
                  "xc": {"field": {"group": "width"}, "mult": 0.5},
                  "yc": {"field": {"group": "height"}, "mult": 0.5, "offset": 2},
                  "align": {"value": "center"},
                  "baseline": {"value": "middle"},
                  "text": {"value": "Show All"},
                  "fontSize": {"value": 14},
                  "stroke": {"value": "#ecf0f1"},
                  "fontWeight": {"value": "bold"}
                }
              }
            }
          ]
        }
      ]
    }
  ],
  "signals": [
    {
      "name": "groupHover",
      "value": {},
      "on": [
        {"events": "@groupMark:mouseover", "update": "{stk1:datum.stack=='stk1' && datum.grpId, stk2:datum.stack=='stk2' && datum.grpId, stk3:datum.stack=='stk3' && datum.grpId, stk4:datum.stack=='stk4' && datum.grpId, stk5:datum.stack=='stk5' && datum.grpId}"},
        {"events": "mouseout", "update": "{}"}
      ]
    },
    {
      "name": "groupSelector",
      "value": false,
      "on": [
        {"events": "@groupMark:click!", "update": "{stack:datum.stack, stk1:datum.stack=='stk1' && datum.grpId, stk2:datum.stack=='stk2' && datum.grpId, stk3:datum.stack=='stk3' && datum.grpId, stk4:datum.stack=='stk4' && datum.grpId, stk5:datum.stack=='stk5' && datum.grpId}"},
        {"events": [{"type": "click", "markname": "groupReset"}, {"type": "dblclick"}], "update": "false"}
      ]
    }
  ]
}"}}

