{"title":"Bot - Sankey","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v3.0.json",
  "data": [
    {
      "name": "rawData",
      "url": {
        "%context%": true,
        "%timefield%": "createdAt",
        "index": "homechoice-sandbox.transcripts",
        "body": {
          "size": 20,
          "aggs": {
            "tables": {
              "filter": {
                "term": {
                  "from.keyword": "bot"
                }
              },
              "aggs": {
                "table": {
                  "terms": {
                    "size": 50,
                    "field": "conversationId.keyword"
                  },
                  "aggs": {
                    "table": {
                      "terms": {
                        "field": "createdAt"
                      },
                      "aggs": {
                        "table": {
                          "terms": {
                            "field": "intent.keyword",
                            "missing": "form"
                          },
                          "aggs": {
                            "table": {
                              "terms": {
                                "field": "from.keyword"
                              }
                            }
                          }
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        }
      },
      "format": {
        "property": "aggregations.tables.table.buckets"
      },
      "transform": [
        {
          "type": "formula",
          "index": "idx",
          "expr": "datum.table.buckets[0].table.buckets[0].key",
          "as": "stk1"
        },

        {
          "type": "formula",
          "expr": 'length(datum.table.buckets)>1? datum.table.buckets[1].table.buckets[0].key: "Finished"',
          "as": "stk2"
        },
        {
          "type": "formula",
          "expr": 'length(datum.table.buckets)>2? datum.table.buckets[2].table.buckets[0].key: "Finished"',
          "as": "stk3"
        },
        {
          "type": "formula",
          "expr": 'length(datum.table.buckets)>3? datum.table.buckets[3].table.buckets[0].key: "Finished"',
          "as": "stk4"
        },
        {
          "type": "formula",
          "expr": 'length(datum.table.buckets)>4? datum.table.buckets[4].table.buckets[0].key: "Finished"',
          "as": "stk5"
        },
        {
          "type": "formula",
          "expr": "datum.table.buckets[0].table.buckets[0].doc_count",
          "as": "size"
        }
      ]
    },
    {
      "name": "nodes",
      "source": "rawData",
      "transform": [
        {"type": "filter", "expr": "!groupSelector || groupSelector.stk1 == datum.stk1 || groupSelector.stk2 == datum.stk2 || groupSelector.stk3 == datum.stk3 || groupSelector.stk4 == datum.stk4 || groupSelector.stk5 == datum.stk5"  },
        {"type": "formula", "expr": "datum.key", "as": "threadId"},
        {"type": "formula", "expr": "datum.stk1+' '+datum.stk2+' '+datum.stk3+' '+datum.stk4+' '+datum.stk5", "as": "key"},
        {"type": "fold", "fields": ["stk1", "stk2", "stk3", "stk4", "stk5"], "as": ["stack", "grpId"]},
        {"type": "formula", "expr": "datum.stack == 'stk1' ? datum.stk1+datum.stk2 : datum.stack == 'stk2' ? datum.stk2+datum.stk3 : datum.stack == 'stk3' ? datum.stk3+datum.stk4 : datum.stack == 'stk4' ? datum.stk4+datum.stk5 : datum.stk5+datum.stk4 ", "as": "sortField"},
        {"type": "stack", "groupby": ["stack"], "sort": {"field": "sortField", "order": "descending"}, "field": "size"},
        {"type": "formula", "expr": "(datum.y0+datum.y1)/2", "as": "yc"}
      ]
    },
    {
      "name": "groups",
      "source": "nodes",
      "transform": [
        {"type": "aggregate", "groupby": ["stack", "grpId"], "fields": ["size"], "ops": ["sum"], "as": ["total"]},
        {"type": "stack", "groupby": ["stack"], "sort": {"field": "grpId", "order": "descending"}, "field": "total"},
        {"type": "formula", "expr": "scale('y', datum.y0)", "as": "scaledY0"},
        {"type": "formula", "expr": "scale('y', datum.y1)", "as": "scaledY1"},
        {"type": "formula", "expr": "scale('y', datum.y2)", "as": "scaledY2"},
        {"type": "formula", "expr": "datum.stack == 'stk1'", "as": "rightLabel"},
        {"type": "formula", "expr": "datum.total/domain('y')[1]", "as": "percentage"}
      ]
    },
    {"name": "seconedNodes", "source": "nodes", "transform": [{"type": "filter", "expr": "datum.stack == 'stk2'"}]},
    {"name": "thirdNodes", "source": "nodes", "transform": [{"type": "filter", "expr": "datum.stack == 'stk3'"}]},
    {"name": "fourthNodes", "source": "nodes", "transform": [{"type": "filter", "expr": "datum.stack == 'stk4'"}]},
    {"name": "fifthNodes", "source": "nodes", "transform": [{"type": "filter", "expr": "datum.stack == 'stk5'"}]},
    {
      "name": "firstnode",
      "source": "nodes",
      "transform": [
        {"type": "filter", "expr": "datum.stack == 'stk1'"},
        {"type": "lookup", "from": "seconedNodes", "key": "key", "fields": ["key"], "as": ["target"]},
        {
          "type": "linkpath",
          "orient": "horizontal",
          "shape": "diagonal",
          "sourceY": {"expr": "scale('y', datum.yc)"},
          "sourceX": {"expr": "scale('x', 'stk1') + bandwidth('x')"},
          "targetY": {"expr": "scale('y', datum.target.yc)"},
          "targetX": {"expr": "scale('x', 'stk2')"}
        },
        {"type": "formula", "expr": "range('y')[0]-scale('y', datum.size)", "as": "strokeWidth"},
        {"type": "formula", "expr": "datum.size/domain('y')[1]", "as": "percentage"}
      ]
    }
    {
      "name": "seconednode",
      "source": "nodes",
      "transform": [
        {"type": "filter", "expr": "datum.stack == 'stk2'"},
        {"type": "lookup", "from": "thirdNodes", "key": "key", "fields": ["key"], "as": ["target"]},
        {
          "type": "linkpath",
          "orient": "horizontal",
          "shape": "diagonal",
          "sourceY": {"expr": "scale('y', datum.yc)"},
          "sourceX": {"expr": "scale('x', 'stk2') + bandwidth('x')"},
          "targetY": {"expr": "scale('y', datum.target.yc)"},
          "targetX": {"expr": "scale('x', 'stk3')"}
        },
        {"type": "formula", "expr": "range('y')[0]-scale('y', datum.size)", "as": "strokeWidth"},
        {"type": "formula", "expr": "datum.size/domain('y')[1]", "as": "percentage"}
      ]
    }
    {
      "name": "thirdnode",
      "source": "nodes",
      "transform": [
        {"type": "filter", "expr": "datum.stack == 'stk3'"},
        {"type": "lookup", "from": "fourthNodes", "key": "key", "fields": ["key"], "as": ["target"]},
        {
          "type": "linkpath",
          "orient": "horizontal",
          "shape": "diagonal",
          "sourceY": {"expr": "scale('y', datum.yc)"},
          "sourceX": {"expr": "scale('x', 'stk3') + bandwidth('x')"},
          "targetY": {"expr": "scale('y', datum.target.yc)"},
          "targetX": {"expr": "scale('x', 'stk4')"}
        },
        {"type": "formula", "expr": "range('y')[0]-scale('y', datum.size)", "as": "strokeWidth"},
        {"type": "formula", "expr": "datum.size/domain('y')[1]", "as": "percentage"}
      ]
    }
    {
      "name": "fourthnode",
      "source": "nodes",
      "transform": [
        {"type": "filter", "expr": "datum.stack == 'stk4'"},
        {"type": "lookup", "from": "fifthNodes", "key": "key", "fields": ["key"], "as": ["target"]},
        {
          "type": "linkpath",
          "orient": "horizontal",
          "shape": "diagonal",
          "sourceY": {"expr": "scale('y', datum.yc)"},
          "sourceX": {"expr": "scale('x', 'stk4') + bandwidth('x')"},
          "targetY": {"expr": "scale('y', datum.target.yc)"},
          "targetX": {"expr": "scale('x', 'stk5')"}
        },
        {"type": "formula", "expr": "range('y')[0]-scale('y', datum.size)", "as": "strokeWidth"},
        {"type": "formula", "expr": "datum.size/domain('y')[1]", "as": "percentage"}
      ]
    }
  ],
  "scales": [
    {"name": "x", "type": "band", "range": "width", "domain": ["stk1", "stk2", "stk3", "stk4", "stk5"], "paddingOuter": 0.05, "paddingInner": 0.95},
    {"name": "y", "type": "linear", "range": "height", "domain": {"data": "nodes", "field": "y1"}},
    {"name": "color", "type": "ordinal", "range": "category", "domain": {"data": "rawData", "fields": ["stk1", "stk2", "stk3", "stk4", "stk5"]}},
    {"name": "stackNames", "type": "ordinal", "range": ["bot Message 1", "bot Message 2", "bot Message 3", "bot Message 4", "bot Message 5" ], "domain": ["stk1", "stk2", "stk3", "stk4", "stk5"]}
  ],
  "axes": [
    {
      "orient": "bottom",
      "scale": "x",
      "encode": {
        "labels": {
          "update": {"text": {"scale": "stackNames", "field": "value"}}
        }
      }
    },
    {"orient": "left", "scale": "y"}
  ],
  "marks": [
    {
      "type": "rect",
      "from": {"data": "nodes"},
      "encode": {
        "enter": {
          "stroke": {"value": "#000"},
          "strokeWidth": {"value": 2},
          "width": {"scale": "x", "band": 1},
          "x": {"scale": "x", "field": "stack"},
          "y": {"field": "y0", "scale": "y"},
          "y2": {"field": "y1", "scale": "y"}
        }
      }
    },
    {
      "type": "path",
      "name": "firstMark",
      "from": {"data": "firstnode"},
      "clip": true,
      "encode": {
        "update": {
          "stroke": [{"test": "groupSelector && groupSelector.stack=='stk1'", "scale": "color", "field": "stk2"}, {"scale": "color", "field": "stk1"}],
          "strokeWidth": {"field": "strokeWidth"},
          "path": {"field": "path"},
          "strokeOpacity": {"signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2) ? 0.9 : 0.3"},
          "zindex": {"signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2) ? 1 : 0"},
          "tooltip": {"signal": "datum.threadId  + ' : ' + datum.stk1 + ' → ' + datum.stk2 + '    ' + format(datum.size, ',.0f') + '   (' + format(datum.percentage, '.1%') + ')'"}
        },
        "hover": {"strokeOpacity": {"value": 0.75}}
      }
    },
    {
      "type": "path",
      "name": "seconedMark",
      "from": {"data": "seconednode"},
      "clip": true,
      "encode": {
        "update": {
          "stroke": [{"test": "groupSelector && groupSelector.stack=='stk2'", "scale": "color", "field": "stk3"}, {"scale": "color", "field": "stk2"}],
          "strokeWidth": {"field": "strokeWidth"},
